import React from "react";
import { Route, Switch, Redirect } from "react-router-dom";
import DeteilPage, { routeDetail as routeDetail } from "../../pages/DeteilPage";
import ContactPage, { routeContact as routeContactPage } from "../../pages/ContactPage";
import MainPage, { routeMain as routeMainPage } from "../../pages/MainPage";
import SecondPage, { routeSecond as routeSecondPage } from "../../pages/SecondPage";
import "./styles.css";



import Footer from "../Footer"
import Header from "../Header";
import { routeDeteil } from "../../pages/MainPage";


const AppConect = () =>{
    return (
        <div className="MainWrapper">
      <Header /> 
      <Switch>
      <Route exact path={routeDeteil()} component={DeteilPage} />
      <Route exact path={routeContact()} component={ContactPage} />
      <Route exact path={routeMain()} component={MainPage} />
      <Route exact path={routeDeteil()} component={DeteilPage} />
      </Switch>
      <Footer />
    </div>
    )
}
export default AppConect;
